import React from 'react';

export default class Table extends React.Component {

    constructor() {
        super()
    }

    render(props) {
        return (
            <table>
                <thead>
                <tr>
                    <th>name</th>
                    <th>last name</th>
                </tr>
                </thead>
                <tbody>
                <tr>
                    <td>{this.props.fname}</td>
                    <td>{this.props.lname}</td>
                </tr>
                </tbody>
            </table>
        );
    }
}
